import { FastField } from "formik";
import React from "react";

export const TypesOfAtt = ({ name }) => {
  console.log("typeOfAtt");
  return (
    <div className="container">
      <div className="text-center fs-5">
        <span>گروه :</span>
      </div>
      <div className="bg-primary input-group">
        <span
          className="input-group-text w-25 d-flex justify-content-center"
          htmlFor=""
        >
          typeOfAtt
        </span>
        <FastField name={name} type="input" className="form-control" />
        <span
          className="input-group-text w-25 d-flex justify-content-center"
          htmlFor=""
        >
          typeOfAtt
        </span>
      </div>
    </div>
  );
};
